import { Component, OnInit } from '@angular/core';
import { ClockService } from './clock.service';
import { Observable } from 'rxjs';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.scss']
})
export class AppComponent implements OnInit {
  title = 'app-yams';
  numbers : number[] = [1, 2, 3, 6];
  clock$: Observable<string>|null = null;
  //clock$! : Observable<string> ;

  constructor(private so : ClockService){ 
   console.log("constructor");
  }

  ngOnInit(): void {
    console.log("oninit");
    this.clock$ = this.so.get();
  }

  onSelect(num : number):void{
    console.log(num);
  }

}
<div class="container-fuild principal">
  <nav class="navbar navbar-expand-lg navbar-light">
    <a class="navbar-brand" href="#">{{ title }}</a>
    <button
      class="navbar-toggler"
      type="button"
      data-toggle="collapse"
      data-target="#navbarNavAltMarkup"
      aria-controls="navbarNavAltMarkup"
      aria-expanded="false"
      aria-label="Toggle navigation"
    >
      <span class="navbar-toggler-icon"></span>
    </button>
    <div class="collapse navbar-collapse" id="navbarNavAltMarkup">
      <ul class="navbar-nav mr-auto">
        <li class="nav-item active">
          <a routerLink="/home" routerLinkActive="active" class="nav-link" ariaCurrentWhenActive="page">Home</a>
        </li>
        <li class="nav-item active">
          <a 
            routerLink="/register" 
            routerLinkActive="active" 
            class="nav-link" 
            ariaCurrentWhenActive="page"
          >register</a>
        </li>
      </ul>
    </div>
    <p>{{ clock$ | async }}</p>
  </nav>
